{"text": "REPORT DATE: 27.09.2021    FILM NO: 

Brain CT;

In the comparative evaluation with the images obtained the day before of the patient, during the follow-up period, a newly developed subdural effusion with a diameter of approximately 5mm at its widest point is observed in the right cerebral convexity.

Hemorrhagic densities that level off and show an increase in both lateral ventricles are observed during the follow-up. The diameter of the 3rd ventricle in the midline is slightly decreased, measured as 9mm in the current examination. Other findings are stable during the follow-up.", "report_id": 19977, "patient_no": 2008801675, "protocol_no": 21606007, "report_length": 67, "report_original": "RAPOR TARİHİ: 27.09.2021    FİLM NO: 

Beyin BT;

Olgunun bir gün önce elde edilen görüntüleri ile karşılaştırmalı değerlendirmede takip süresince sağ serebral konveksitede yeni gelişen ve en geniş yerinde yaklaşık 5mm çapında ölçülen subdural efüzyon izlenmektedir. 

Her iki lateral ventrikül içerisinde seviyelenme veren ve takipte artış gösteren hemorajik dansiteler izlenmektedir. 
Orta hatta 3. ventrikül çapı hafif azalmış, güncel tetkikte 9mm olarak ölçülmektedir. Diğer bulgular takipte stabildir.", "patient_report_count": 8}

{"text": "REPORT DATE: 04.01.2022 FILM NO:

Brain CT;

Defective findings secondary to the surgery have been observed in the left frontal and temporal bones, with consistent findings of pneumocephalus in the vicinity of both frontal lobes anteriorly and the temporal lobe. A minimal subdural hemorrhage, appearing as a band-like shape, is observed in the vicinity of the surgical site, extending to the right parasellar level, drawing attention to the appearance of the catheter. Similarly, findings consistent with subarachnoid hemorrhage are observed at the level of the Sylvian fissure on the left.

A shift of approximately 5mm in size towards the right is observed in the midline brain structures. Findings consistent with compression are observed in the left lateral ventricle.", "report_id": 27163, "patient_no": 2009437125, "protocol_no": 22035840, "report_length": 92, "report_original": "RAPOR TARİHİ: 04.01.2022    FİLM NO:

Beyin BT;

Solda frontal ve temporal kemikte geçirilmiş operasyona sekonder defektif bulgular izlenmiş olup her iki frontal lob anteriorunda ve temporal lob komşuluğunda pnömosefali ile uyumlu bulgular izlenmiştir. Operasyon loju komşuluğunda sıvama şeklinde minimal subdural hemoraji ile uyumlu görünüm izlenmiş olup operasyon lojundan sağ parasellar düzeye uzanım gösteren katetere ait görünüm dikkati çekmektedir. Yine solda silviyan fissür düzeyinde subaraknoid kanama ile uyumlu bulgular dikkati çekmektedir. 

Beyin orta hat yapılarında sağ doğru yaklaşık 5mm boyutta şift varlığı izlenmiştir. Sol lateral ventrikülde bası ile uyumlu bulgular dikkati çekmektedir.", "patient_report_count": 9}

{"text": "REPORT DATE: 20.09.2021  FILM NO:

Brain CT;

In sections obtained between the base of the skull and the vertex;

The fourth ventricle and basal cisterns are of normal width. Posterior fossa formations are normal.

The third ventricle is midline and of normal width. Lateral ventricles are normal. No displacement is detected in the midline structures of the brain.

On the right side, at the level of the vertex and adjacent to the parietal bone, a subgaleal hematoma area consistent with trauma is observed in the subcutaneous soft tissue. A fracture line extending vertically and reaching the pyramidal component is observed in the temporal bone squamous part. At the level of the temporal fossa on the right and adjacent to the arcus, millimetric air lucencies are observed at the level of the masseter muscle planes. Millimetric air lucencies are also observed in the anterior vicinity of the temporal lobe and in the medial part of the temporal lobe. Areas of parenchymal hemorrhage reaching a diameter of 1cm in the widest area observed within the sulcal structures near the fracture line in the lateral part of the right temporal lobe, and density changes consistent with subarachnoid hemorrhage are observed within the right frontal lobe. 

In the vicinity of the left frontal lobe, findings consistent with subdural hemorrhage reaching a diameter of 6mm in the widest area draw attention. In the lateral vicinity of the left temporal lobe, density differences reaching approximately 9-10mm in diameter consistent with intraparenchymal hemorrhage, and millimetric pneumocephalus findings in the neighboring area at this level are notable.", "report_id": 7336, "patient_no": 2006085488, "protocol_no": 21628695, "report_length": 184, "report_original": "RAPOR TARİHİ: 20.09.2021    FİLM NO:

Beyin BT;

Kafa tabanı ve verteks arasından elde olunan kesitlerde;

4.ventrikül ve bazal sisternalar normal genişliktedir. Posterior fossa oluşumları olağandır.

3.ventrikül orta hatta ve normal genişliktedir. Lateral ventriküller olağandır. Beyin orta hat yapılarında yer değiştirme saptanmamıştır.

Sağda verteks düzeyinde ve parietal kemiğe komşu cilt altı yumuşak dokuda travmaya sekonder subgaleal hematom alanı ile uyumlu görünüm izlenmektedir. Temporal kemik skuamöz parçasında vertikal seyirde ve piramidal bileşkeye dek uzanan fraktür hattı ile uyumlu görünüm izlenmektedir. Sağda temporal fossa düzeyinde ve arkus komşuluğunda masseter kas planları düzeyinde miimetrik boyutta hava lüsensileri izlenmektedir. Yine temporal lob anterior komşuluğunda ve temporal lob medialinde de milimetrik boyutta hava lüsensileri gözlenmiştir. Sağda temporal lob lateralinde fraktür hattına yakın alanda sulkal yapılar içerisinde de izlenen en geniş yerinde 1cm çapa ulaşan parankimal kanama alanları, yine sağ frontal lob içerisinde de subaraknoid kanama ile uyumlu dansite değişiklikleri izlenmiştir. 
Sol frontal lob komşuluğunda en geniş yerinde 6mm çapa ulaşan subdural hemoraji ile uyumlu bulgular dikkati çekmektedir. Solda temporal lob lateral komşuluğunda intraparankimal hemoraji ile uyumlu yaklaşık 9-10mm çapa ulaşan dansite farklıklıkları ve bu düzeyede komşuda milimetrik boyutta pnömosefali bulguları dikkati çekmektedir.", "patient_report_count": 4}

{"text": "REPORT DATE: 11.01.2022    MOVIE NO:

Brain CT;

A cranial defect in the left frontotemporal bone is observed. Thickening and post-operative effusion areas are seen in this region. Additionally, subdural air densities and subacute - subdural hematoma are observed at the anterior level of the temporal lobe. The gyri in the left cerebral convexity appear edematous. The left lateral ventricle appears significantly compressed due to edema. A 10mm shift to the right is observed in the midline structures.

A noticeable density loss is observed at the level of the left vertex. The previously observed subarachnoid air densities appear to be resorbed in the current examination, however, gliotic density loss is progressing in the left temporal and occipital areas. Compared to the examination on 26.12.2021, the post-operative extra-axial hemorrhagic findings appear to have regressed. There is progressing edema effect and midline shift in the brain parenchyma. A significant gliosis is present in the occipital area, which was not observed in the previous examination but is seen in the current examination.", "report_id": 27162, "patient_no": 2009437125, "protocol_no": 22035840, "report_length": 127, "report_original": "RAPOR TARİHİ: 11.01.2022    FİLM NO:

Beyin BT;

Sol frontotemporal kemikte kraniaktomi defekti izlenmektedir. Bu düzeyde durada kalınlaşma ve ekstraaksiyel alanda post op efüzyon alanları izlenmektedir. Ayrıca temporal lob anterior düzeyde subdural hava dansiteleri ve sıvama subakut -subdural hematom izlenmektedir. Sol serebral konveksitede giruslar ödemli görünümdedir. Sol lateral ventrikül ödem etkisi ile belirgin basılanmış görünümdedir. Orta hat yapılarında 10mm sağa şift izlenmektedir. 

Sol verteks düzeyinde belirgin dansite kaybı dikkati çekmektedir. Önceki tetkikte izlenen SAK dansiteleri güncel tetkikte rezorbe görünümdedir ancak sol temporal ve okspitalde gliotik dansite kaybı progresyon göstermektedir. Hastanın 26.12.2021 tarihli tetkiki ile kıyaslamalı değerlendirmede post operatif ekstraaksiyel hemorajik bulgular regrese görünümdedir. Beyin parankiminde progresyon gösteren ödem etkisi ve orta hat şift bulgusu mevcuttur. Önceki tetkikte sol okspitalde izlenmeyen ve güncel tetkikte izlenen belirgin gliozis mevcuttur.", "patient_report_count": 9}

{"text": "REPORT DATE: 04/01/2022           EXAMINATION NUMBER:

BRAIN CT

In the sections obtained between the skull base and vertex;

In the comparative examination with the previous examination of the patient, no catheter extending to the parasellar level was observed.

In the current examination, a subarachnoid hemorrhage consistent with the operation lodge neighborhood on the left side and at the level of the Sylvian fissure was observed in a stable appearance. Minimal regression in pressure was observed in the left lateral ventricle. A 3mm-sized shift towards the right was observed in the midline structures.", "report_id": 27156, "patient_no": 2009437125, "protocol_no": 22035840, "report_length": 86, "report_original": "RAPOR TARİHİ: 04/01/2022            TETKİK NO:

BEYİN BT 

Kafa tabanı ve verteks arasından elde olunan kesitlerde;

Hastanın  bir önceki tetkiki  ile yapılan karşılaştırmalı bakıda mevcut  bulgularda parasellar düzeye uzanan kateter izlenmemiştir.

Solda operasyon loju komşuluğunda ve  silvian fissür  düzeyinde  izlenen  subaraknoid kanama ile uyumlu mevcut  tetkikte stabil görünümde izlenmiştir. Sol lateral ventriküldeki bası minimal regrese görünümde izlenmiştir.  Orta hat yapılarında sağa doğru yaklaşık  3mm boyutlu şift varlığı  gözlenmiştir.

", "patient_report_count": 9}

{"text": "REPORT DATE: 10/12/2021
FILM NO:

Brain CT without contrast examination;

Widespread hyperdense appearances consistent with subarachnoid hemorrhage are observed in the cerebral sulci and along the tentorium. A compatible appearance with ruptured aneurysm is present in the right ACA localization. Evaluation of the patient's brain with angiographic CT is recommended.
Low density areas consistent with edema are observed in both frontal and parietal lobes in the parenchyma.
The ventricular system is mildly compressed due to edema.", "report_id": 7142, "patient_no": 2006070659, "protocol_no": 21966326, "report_length": 81, "report_original": "RAPOR TARİHİ:10/12/2021   FİLM NO:

Kontrastsız   beyin  BT  tetkiki;

Serebral sulkuslarda   ve tentorium  boyunca uzanan  yaygın SAK ile  uyumlu hiperdens  görünümler izlenmektedir. Sağ  ACA lokalizasyonunda  anevrizma rüptürü ile uyumlu  görünüm  mevcuttur. Hastanın   beyin  anjio  BT ile  değerlendirilmesi  önerilir.
Her iki frontal  ve parietal lobda parankimde  ödme ile   uyumlu   düşük dansitede alanlar izlenmektedir.
Ventriküler sistem ödeme sekonder hafif basılanmıştır.", "patient_report_count": 5}

{"text": "REPORT DATE: 27/10/2021   FILM NO:12372462

Brain CT Examination;

Attention is drawn to subdural hemorrhage reaching a thickness of 4.5mm at the level of both frontal regions and in the right parietal and temporal regions at the level of frontotemporoparietal lobes, and contusion areas with a diameter of 8mm in size that are consistent with increased density on CT scans. In the left parietal region, there is an increase in density related to subarachnoid hemorrhage in the sulci, and a subdural hemorrhage area with a thickness of 4.5mm is present in the occipital lobe and left posterior fossa adjacent to the cerebellar hemisphere, along with air values related to pneumocephalus. Moreover, air values consistent with pneumocephalus are also observed in the anterior regions of the right temporal lobe, right frontal lobe, and the subdural space in the right frontal lobe localization. No significant midline shifts are identified. The ventricular system appears normal in the current examination. There is narrowing and obliteration of cerebral hemispheric sulci due to edema.
At the oksipitotemporal junction level on the left side, a non-displaced fracture line continuing along the suture is observed.
Partial loss of aeration is present in the paranasal sinuses during the examination.", "report_id": 26716, "patient_no": 2009424446, "protocol_no": 21881146, "report_length": 183, "report_original": "RAPOR TARİHİ:27/10/2021   FİLM NO:12372462

Beyin   BT   Tetkiki;

Her iki frontal bölgede sağ perietal   ve  temporal bölgede  frontotemporaparietal  loblar düzeyinde   4,5mm  kalınlığa ulaşan subdural  hemoraji ve büyüğü 8mm çaplı parankimal   kontüzyon alanları  SAK ile uyumlu dansite artışları  dikkati  çekmektedir. Sol parietal bölgede sulkuslarda SAK a  bağlı dansite artışı ve  oksipital   lob ve sol posterior  fossada serebeller hemisfer komşuluğunda   4,5mm kalınlıkta subdural  hemoraji alanı  ve  pnömosefalusa ait  hava değerleri  mevcuttur. Ayrıca sağ temporal  lob ön bölümünde de  sağ frontal ön bölümünde de ve sağ frontal lob  lokalizasyonunda  subdural mesafede pnömosefali.ile uyumlu    hava değerleri dikkati çekmektedir. Orta hat yapılarda  belirgin  şift ayırt edilmemiştir. Ventriküler sistem  mevcut  tetkikte olağan görünümdedir. Serebral hemisferik sulkuslarda ödeme bağlı  daralma ve obliterasyon izlenmektedir.
Solda oksipitotemporal birleşke düzeyinde  suture doğruda devam eden  non deplase  fraktür hattı izlenmektedir.
İnceleme dahilinde paranazal sinüslerde  yer yer   havalanma kaybı mevcuttur.", "patient_report_count": 15}

{"text": "REPORT DATE: 02/21/2022   FILM NUMBER: 12506694

Contrastless brain CT scan;
Time: 14:13

This scan has been evaluated by comparing it with the CT scan obtained at 10:05 a.m. on the same day. The remains of hemorrhagic contusion areas are notable in the left frontal region. There is an acute traumatic subdural hematoma at the level of the left cerebral convexity, indicating a hematocrit level increase, and the thickness of the hematoma measures 8mm with some progression. There is a slight worsening of the edema findings in the left cerebral hemisphere. Additionally, the spread of the subdural hemorrhage into the interhemispheric fissure is notable. There is a shift towards the right in the midbrain structures, and the thickness of the shift measures approximately 9mm, indicating a slight worsening.

In this case, findings related to traumatic subarachnoid hemorrhage are shown again in the level of the left cerebral convexities. Mild displacement and fracture lines are shown in the left temporal and occipital bones in the evaluation of the bone structures. No significant radiological difference has been detected in these findings.", "report_id": 16913, "patient_no": 2008509284, "protocol_no": 22344550, "report_length": 165, "report_original": "RAPOR TARİHİ: 21/02/2022   FİLM NO:12506694

Kontrastsız   beyin     BT tetkiki;
Saat:14:13

Bu tetkik olgunun aynı gün saat 10:05 te  elde olunan BT si ile  kıyaslanarak değerlendirilmiştir. Sol frontalde hemorjaik kontüzyon sahalarının  artığı dikkati çekmektedir. Sol  serebral  konveksite düzeyinde  hematokrit seviyelenmesi  veren akut travmatik subdural hematomun varlığı  mevcut olup hematom  kalınlığı  8mm ölçülmüştür ve  bir miktar  progresyon izlenmiştir. Sol serebral hemisferdeki   ödem bulgularında bir miktar  kötüleşme  mevcuttur. Ayrıca subdural kanamanın interhemisferik   fissüre yayıldığı  dikkati çekmektedir. Beyin orta yapılarında sağa doğru  şift mevcut olup şift kalınlığı   yaklaşık 9mm ölçülmüştür ve biraz daha kötüleştiği dikkati  çekmektedir.
Bu olguda sol serebral konveksiteler  düzeyinde   yer yer travmatik   subaraknoid kanamaya ait   bulgularda tekrar gösterilmiştir.
Kemik yapıların değerlendirilmesinde sol temporalde ve oksipitalde  yer yer hafif deplasman gösteren  fraktür hatları tekrar  gösterilmiştir. Bu bulgularda anlamlı radyolojik fark saptanmamıştır.", "patient_report_count": 20}

{"text": "REPORT DATE: 11/02/2022   FILM NO: 12481642

In the angiographic CT examination performed for the arterial structures of the brain;

A saccular aneurysmatic dilation of 4.5 mm was observed at the level of the anterior communicating artery.
Both anterior cerebral arteries, middle cerebral artery, and posterior cerebral artery calibrations are normal and no additional findings are detected at these levels.", "report_id": 19483, "patient_no": 2008752100, "protocol_no": 22257599, "report_length": 44, "report_original": "RAPOR TARİHİ: 11/02/2022   FİLM NO: 12481642

Beyin arterial yapılarına yönelik yapılan anjio BT tetkikinde;

Anterior kominikan arter düzeyinde 4,5 mm lik sakküler anevrizmatik genişleme izlenmiştir.
Her iki anterior serebral arter, orta serebral arter ve posterior serebral arter kalibrasyonları doğal olup bu düzeylerde ek bulgu saptanmamıştır.", "patient_report_count": 5}

{"text": "REPORT DATE: 27/12/2021   FILM NO:

Plain brain CT examination;

Infratentorial sections show normal brainstem and cerebellum, as well as the fourth ventricle. Basal cisterns are clear.
On examination of supratentorial sections, the widths of the lateral and third ventricles are slightly increased, and cerebral sulci are mildly prominent. No midline shifts are detected. No intraparenchymal formations of different densities are observed. A comparison with the images taken on 17/02/2021 shows regression of previous postoperative changes and resolution of the left subdural hematoma. In the current examination, a burr hole defect in the left parietal region is notable. In the posterior parietal area, a soft tissue lesion with an approximate diameter of 2.5cm, consistent with a fibroma beneath the skin, is observed.", "report_id": 26, "patient_no": 2004004697, "protocol_no": 22023602, "report_length": 128, "report_original": "RAPOR TARİHİ:27/12/2021   FİLM NO:

Kontrastsız  beyin   BT  tetkiki;

İnfratentorial  kesitlerde   beyin sapı serebellum  4. ventrikül  olağandır. Bazal sisternalar açıktır.
Supratentorial  kesitlerin   incelemesinde  lateral ve 3. ventrikül   genişlikleri  serebral  sulkuslar  hafif  belirginleşmiştir.Orta hat yapılarında  şift saptanmadı. İntraparankimal   farklı dansitede yer kaplayan oluşum saptanmadı. Olgunun 17/02/2021 tarihli   görüntüleri ile karşılaştırıldığında daha önceki post op değişikliklerin regrese olduğu sol   subdural hematomun   rezorbe olduğu görülmüştür. Güncel  tetkikte  solda  parietal  bölgede  burr hole defekti  dikkati çekmektedir. Posterior parietal alanda  cilt altında  fibrom ile  uyumlu olabilecek  yaklaşık   2,5cm çaplı yumuşak  doku  lezyonu izlenmiştir.
", "patient_report_count": 19}

{"text": "REPORT DATE: 08/02/2022   FILM NO: 12506525

Contrastless brain CT scan;

Infratentorial structures are normal.
In the evaluation of supratentorial structures, there is a traumatic subdural hematoma reaching 7mm at the thickest point at the level of the interhemispheric fissure and left cerebral convexity. Hemorrhagic contusion areas are observed in the left frontal and anterior segment of the left temporal lobe. There are also findings reflecting traumatic subarachnoid hemorrhage in some areas of the left frontal region. The left cerebral hemisphere is edematous, and there is an approximately 7mm shift towards the right side in the midline structures of the brain.
In the evaluation of bone structures, the presence of a fracture line at the level of the left occipital bone is noticeable. Additionally, there are small areas of pneumocephalus.", "report_id": 16909, "patient_no": 2008509284, "protocol_no": 22344550, "report_length": 113, "report_original": "RAPOR TARİHİ:08/02/2022   FİLM NO:12506525

Kontrastsız  beyin  BT tetkiki;

İnfratentorial yapılar normaldir.
Supratentorial yapıların  değerlendirilmesinde interhemisferik  fissürde ve sol  serebral   konveksite düzeyinde en kalın  yerinde 7mm ye  ulaşan  travmatik subdural hematomun varlığı mevcuttur. Sol  frontalde hemorajik kontüzyon sahaları  ve sol temporal  lob anterior kesimde hemorajik  kontüzyon alanları izlenmiştir. Sol frontalde yer yer travmatik  subaraknoid kanamayo yansıtan bulgularda mevcuttur. Sol serebral hemisfer ödemlidir ve beyin  orta hat  yapılarında  sağ tarafa doğru yaklaşık 7mm lik  şiftin varlığı izlenmiştir.
Kemik yapıların değerlendirilmesinde sol oksipital kemik düzeyinde  fraktür hattının varlığı dikkati çekmektedir. Ayrıca  küçük  pnömosefali alanlarıda  mevcuttur.", "patient_report_count": 20}

{"text": "REPORT DATE: 17.06.2022    FILM NO: 12640981

Cranial CT;

In the sections obtained between the base of the skull and the vertex;

