{"text": "REPORT DATE: 29.08.2022    FILM NO:

In the sections obtained between the skull base and the vertex;

A cranial defect is observed in the right frontotemporal bone. At this level, a 17mm extracerebral effusion containing air densities and hemorrhagic densities is observed. Widespread digital edema findings are observed in the right parietotemporal region. In the anterior part of the right temporal lobe, there is an approximately 3x3cm surgical cavity containing hemorrhagic and air densities, as well as suture materials. The cerebral sulci on the right side are effaced and the gyri appear edematous. Midline structures show a 14mm shift to the left. The right lateral ventricle is compressed.", "report_id": 29146, "patient_no": 2009500983, "protocol_no": 22880747, "report_length": 79, "report_original": "RAPOR TARİHİ: 29.08.2022    FİLM NO:

Kafa tabanı ve verteks arasından elde olunan kesitlerde;

Sağ frontotemporal kemikte kraniatomi defekti izlenmektedir. Bu düzeyde içersinde hava dansiteleri ve hemorajik dansiteler bulunduran 17mm lik ekstraaksiyal efüzyon izlenmektedir. Sağ parietotemporalde yaygın digital ödem bulguları izlenmektedir. Sağ temporal lob anteriorda içersinde hemorajik ve hava dansiteleri bulunduran yaklaşık 3x3cm lik operasyon kavitesi ve içersinde sutür materyalleri izlenmektedir. Sağda serebral sulkuslar silinmiş giruslar ödemli görünümdedir. Orta hat yapılarında 14mm sola şift saptanmaktadır. Sağ lateral ventrikül basılanmıştır.", "patient_report_count": 12}

{"text": "DATE OF RECORD: 09.04.2022     FILM NO: 12586520

Contrastless Brain CT;

In the sections obtained between the skull base and vertex;

The skull base and calvarial bone structures are within normal limits.

The fourth ventricle and basal cisterns are of normal width. Posterior fossa formations are normal.

The third ventricle is in the midline and of normal width.

In the left cerebral convexity, a view consistent with a subdural hemorrhage with a diameter of approximately 14 mm at its widest point is observed, and on the right, a view consistent with a subdural hemorrhage with a diameter of approximately 6 mm is observed. In both cerebellar hemispheres, there is a minimal decrease in gray-white matter differentiation due to edema, and more prominent compression is observed in the anterior of the left lateral ventricle. A shift with a diameter of approximately 7 mm to the right is observed in midline brain structures. A hyperdense appearance consistent with millimeter-sized bleeding in the vicinity of the precentral gyrus within the subdural bleeding area on the left in the ventricular alignment attracts attention.", "report_id": 28244, "patient_no": 2009476520, "protocol_no": 22548423, "report_length": 121, "report_original": "
ÇEKİM  TARİHİ: 09.04.2022	     FİLM NO:   12586520

Kontrastsız Beyin BT;

Kafa tabanı ve verteks arasından elde olunan kesitlerde;

Kafa kaidesi ve kalvarial kemik yapılar normal sınırlardadır.

